import React from 'react';

function About() {
    const numbers = ["1、how to use Router", "2、how to use net net component", 3, 4, 5];
    const listItems = numbers.map((number) =>
        <li>{number}</li>
    );
    return (
        <div>
            <h3>This is a react learning case :</h3>
            <ul>{listItems}</ul>
        </div>
    );
}

export default About;
